<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ðŸ’•</title>
    <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;600;700&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Poppins', sans-serif;
            background: linear-gradient(-45deg, #000000, #1a1a1a, #2d2d2d, #404040);
            background-size: 400% 400%;
            animation: gradientBG 15s ease infinite;
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden;
            position: relative;
        }

        @keyframes gradientBG {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }

        .particles {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            z-index: 0;
        }

        .particle {
            position: absolute;
            border-radius: 50%;
            pointer-events: none;
            opacity: 0.6;
            animation: float-up linear infinite;
        }

        @keyframes float-up {
            0% {
                bottom: -100px;
                transform: translateX(0) rotate(0deg);
                opacity: 0;
            }
            10% { opacity: 0.6; }
            90% { opacity: 0.6; }
            100% {
                bottom: 110%;
                transform: translateX(100px) rotate(360deg);
                opacity: 0;
            }
        }

        .container {
            text-align: center;
            background: rgba(255, 255, 255, 0.05);
            backdrop-filter: blur(10px);
            padding: 25px 35px;
            border-radius: 30px;
            box-shadow: 0 20px 80px rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.1);
            max-width: 450px;
            width: 90%;
            position: relative;
            z-index: 1;
            animation: slideIn 0.6s ease-out;
        }

        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateY(50px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .bear {
            width: 350px;
            height: 350px;
            margin: 0 auto 20px;
            display: block;
        }

        .bear img {
            width: 100%;
            height: 100%;
            object-fit: contain;
        }

        @keyframes bounce {
            0%, 100% { transform: translateY(0) scale(1); }
            50% { transform: translateY(-20px) scale(1.05); }
        }

        h1 {
            color: #ffffff;
            font-size: 30px;
            margin-bottom: 40px;
            font-weight: 600;
            line-height: 1.4;
            animation: fadeIn 0.8s ease-out 0.3s backwards;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .buttons {
            display: flex;
            gap: 20px;
            justify-content: center;
            align-items: center;
            margin-top: 30px;
            animation: fadeIn 1s ease-out 0.5s backwards;
        }

        button {
            font-size: 19px;
            padding: 16px 40px;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            font-weight: 600;
            transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
            font-family: 'Poppins', sans-serif;
            position: relative;
            overflow: hidden;
        }

        button::before {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            width: 0;
            height: 0;
            border-radius: 50%;
            background: rgba(255, 255, 255, 0.5);
            transform: translate(-50%, -50%);
            transition: width 0.6s, height 0.6s;
        }

        button:active::before {
            width: 300px;
            height: 300px;
        }

        #yesBtn {
            background: linear-gradient(135deg, #ffffff 0%, #e0e0e0 100%);
            color: #000000;
            box-shadow: 0 10px 30px rgba(255, 255, 255, 0.3);
        }

        #yesBtn:hover {
            transform: translateY(-5px) scale(1.05);
            box-shadow: 0 15px 40px rgba(255, 255, 255, 0.5);
        }

        #noBtn {
            background: linear-gradient(135deg, #404040 0%, #1a1a1a 100%);
            color: #ffffff;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.5);
            border: 1px solid rgba(255, 255, 255, 0.2);
        }

        #noBtn:hover {
            transform: translateY(-5px);
            box-shadow: 0 15px 40px rgba(0, 0, 0, 0.7);
        }

        .success-screen {
            display: none;
            text-align: center;
            animation: popIn 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        @keyframes popIn {
            0% {
                opacity: 0;
                transform: scale(0.3);
            }
            50% {
                transform: scale(1.1);
            }
            100% {
                opacity: 1;
                transform: scale(1);
            }
        }

        .success-screen img {
            max-width: 300px;
            width: 100%;
            border-radius: 20px;
            margin-bottom: 30px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
            animation: rotateIn 0.8s ease-out;
        }

        @keyframes rotateIn {
            from {
                opacity: 0;
                transform: rotate(-180deg) scale(0);
            }
            to {
                opacity: 1;
                transform: rotate(0) scale(1);
            }
        }

        .success-screen h2 {
            color: #ffffff;
            font-size: 28px;
            font-weight: 700;
            line-height: 1.4;
            animation: slideUp 0.8s ease-out 0.3s backwards;
        }

        @keyframes slideUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .heart-burst {
            position: fixed;
            pointer-events: none;
            z-index: 1000;
        }

        .heart-particle {
            position: absolute;
            font-size: 20px;
            animation: heartBurst 1s ease-out forwards;
        }

        @keyframes heartBurst {
            0% {
                opacity: 1;
                transform: translate(0, 0) scale(0);
            }
            100% {
                opacity: 0;
                transform: translate(var(--tx), var(--ty)) scale(1);
            }
        }
    </style>
</head>

            <h1>Ð¿Ð¾Ñ‚Ñ€Ð°Ñ…Ð°ÐµÐ¼ÑÑ 14 Ñ„ÐµÐ²Ñ€Ð°Ð»Ñ?</h1>
            <div class="buttons">
                <button id="yesBtn">Ð´Ð°</button>
                <button id="noBtn">Ð½ÐµÑ‚</button>
            </div>
        </div>

        <div class="success-screen" id="successScreen">
            <img src="https://media.giphy.com/media/v1.Y2lkPTc5MGI3NjExcWQ3aGxvZmJpYzBsMHJ3YjN5OHRsMGxhZGRjNmh3bHN3N2NvOGNiNSZlcD12MV9pbnRlcm5hbF9naWZfYnlfaWQmY3Q9Zw/MDJ9IbxxvDUQM/giphy.gif" alt="cute">
            <h2>Ñ Ð·Ð½Ð°Ð» Ñ‡Ñ‚Ð¾ Ñ‚Ñ‹ Ð·Ð°Ñ…Ð¾Ñ‡ÐµÑˆÑŒ</h2>
        </div>
    </div>

    <script>
        let noClickCount = 0;
        const yesBtn = document.getElementById('yesBtn');
        const noBtn = document.getElementById('noBtn');
        const questionScreen = document.getElementById('questionScreen');
        const successScreen = document.getElementById('successScreen');
        const particlesContainer = document.getElementById('particles');

        // Create floating particles
        function createParticle() {
            const particle = document.createElement('div');
            particle.className = 'particle';
            
            const size = Math.random() * 8 + 4;
            const left = Math.random() * 100;
            const duration = Math.random() * 6 + 4;
            const delay = Math.random() * 5;
            
            const colors = ['#ffffff', '#e0e0e0', '#c0c0c0', '#a0a0a0', '#808080', '#606060'];
            const color = colors[Math.floor(Math.random() * colors.length)];
            
            particle.style.width = size + 'px';
            particle.style.height = size + 'px';
            particle.style.left = left + '%';
            particle.style.background = color;
            particle.style.animationDuration = duration + 's';
            particle.style.animationDelay = delay + 's';
            
            particlesContainer.appendChild(particle);
            
            setTimeout(() => particle.remove(), (duration + delay) * 1000);
        }

        // Create initial particles
        for (let i = 0; i < 30; i++) {
            createParticle();
        }

        // Continuously create particles
        setInterval(createParticle, 400);

        // Heart burst effect
        function createHeartBurst(x, y) {
            const burst = document.createElement('div');
            burst.className = 'heart-burst';
            burst.style.left = x + 'px';
            burst.style.top = y + 'px';
            document.body.appendChild(burst);

            for (let i = 0; i < 12; i++) {
                const heart = document.createElement('div');
                heart.className = 'heart-particle';
                heart.innerHTML = 'ðŸ’•';
                
                const angle = (i / 12) * Math.PI * 2;
                const distance = 100 + Math.random() * 50;
                const tx = Math.cos(angle) * distance;
                const ty = Math.sin(angle) * distance;
                
                heart.style.setProperty('--tx', tx + 'px');
                heart.style.setProperty('--ty', ty + 'px');
                
                burst.appendChild(heart);
            }

            setTimeout(() => burst.remove(), 1000);
        }

        noBtn.addEventListener('click', function(e) {
            noClickCount++;
            const currentSize = parseFloat(window.getComputedStyle(yesBtn).fontSize);
            const currentPadding = parseFloat(window.getComputedStyle(yesBtn).paddingLeft);
            
            yesBtn.style.fontSize = (currentSize + 4) + 'px';
            yesBtn.style.padding = (currentPadding + 3) + 'px ' + (currentPadding * 2 + 6) + 'px';
            
            // Shake animation on no button
            noBtn.style.animation = 'none';
            setTimeout(() => {
                noBtn.style.animation = 'shake 0.5s';
            }, 10);
        });

        yesBtn.addEventListener('click', function(e) {
            createHeartBurst(e.clientX, e.clientY);
            
            questionScreen.style.display = 'none';
            successScreen.style.display = 'block';
            
            // Create celebration particles
            for (let i = 0; i < 50; i++) {
                setTimeout(createParticle, i * 50);
            }
            
            setTimeout(() => {
                window.location.href = 'https://www.youtube.com/watch?v=dQw4w9WgXcQ';
            }, 3000);
        });

        // Add shake animation
        const style = document.createElement('style');
        style.textContent = `
            @keyframes shake {
                0%, 100% { transform: translateX(0); }
                25% { transform: translateX(-10px); }
                75% { transform: translateX(10px); }
            }
        `;
        document.head.appendChild(style);
    </script>
